import React, { useState } from "react";
import "./ExpensesFilter.css";

const ExpensesFilter = () => {
  const [year, setYear] = useState;

  const optionOneChangeHandler = (event) => {};
  const optionTwoChangeHandler = (event) => {};
  const optionThreeChangeHandler = (event) => {};
  const optionFourChangeHandler = (event) => {};
  return (
    <div className="expenses-filter">
      <div className="expenses-filter__control">
        <label>Filter by year</label>
        <select>
          <option value="2022" onChange={optionOneChangeHandler}>
            2022
          </option>
          <option value="2021" onChange={optionTwoChangeHandler}>
            2021
          </option>
          <option value="2020" onChange={optionThreeChangeHandler}>
            2020
          </option>
          <option value="2019" onChange={optionFourChangeHandler}>
            2019
          </option>
        </select>
      </div>
    </div>
  );
};

export default ExpensesFilter;
